        <div class="welcome2" v-bind:class="{classEmpty2: isEmpty}">Mini Digital Branch BPJS Ketenagakerjaan</div>
        <hr>
        <div class="row">
            <div v-for="user in users" :key="user.id" v-bind:class="classMD">
              <transition name="animate" enter-active-class="animated zoomInDown" leave-active-class="animated zoomOutUp">
                <!-- <img class="dishPhoto animated infinite tada slow" alt="Vue logo" src="../assets/default-profile-picture.png" height="190dp" width=auto /> -->
                <img v-if="user.foto !== null && user.foto !== ''" class="animated infinite tada slow img-guest" alt="Vue logo" v-bind:src="'data:image/png;base64, ' + user.foto" height="110dp" width="auto" />
                <img v-else class="animated infinite tada slow" alt="Vue logo" src="data:image/png;base64, " height="108dp" width=auto />
              </transition>
              <br><br><br>
              <section>
              <!-- <transition name="bounce"> -->
              <!-- </transition> -->
              
              <!-- <transition name="animate" enter-active-class="animated flipInY" leave-active-class="animated zoomOutRight">
