              <transition name="animate" enter-active-class="animated zoomInDown">
                  <h1 v-if="animated" v-bind:style="{ fontSize: nameFontSize + 'px' }" style="text-transform: uppercase;"><b>{{ user.nama }}</b></h1>
              </transition>

              <transition name="animate" enter-active-class="animated zoomIn">
                  <h6 v-if="animated" v-bind:style="{ fontSize: emailFontSize + 'px' }">
                    <div v-if="user.email.length < 34 || usersLength <= 3">({{ user.email }})</div>
                    <div v-else>({{ user.email.substring(0,33) + "..." }})</div>
                </h6>
