<script>
import UserService from '../UserService';

export default {
    name: 'Peserta',
    data() {
        return {
            users: [],
            usersLength: 0,
            isEmpty: true,
            classMD: 'col-md-12',
            nameFontSize: 8,
            emailFontSize: 6,
            error: '',
            animated: false
        }
    },
    props: {
        msg: String
    },
    created() {
        this.fetchData
    },
    methods: {
        fetchData: async function () {
            try {
                this.users = await UserService.getUsers();
                console.log("JUMLAH USER" + this.users.length);
                if(typeof this.users !== 'undefined') {
                  this.usersLength = this.users.length;
                } else {
                  this.usersLength = 0;
                }

                if(this.usersLength == 5) {
                  this.classMD = 'col-md-5ths';
                } else {
                  this.classMD = 'col-md-' + 12/this.usersLength;
                }

                if(this.usersLength != 0) {
                  this.isEmpty = false;
                } else {
                  this.isEmpty = true;
                }
                console.log(this.usersLength);

                if(this.usersLength == 1) {
                  this.nameFontSize = 26;
                  this.emailFontSize = 18;
                } else if(this.usersLength == 2) {
                  this.nameFontSize = 20;
                  this.emailFontSize = 16;
                } else if(this.usersLength == 3) {
                  this.nameFontSize = 18;
                  this.emailFontSize = 12;
                } else if(this.usersLength == 4) {
                  this.nameFontSize = 14;
                  this.emailFontSize = 10;
                } else if(this.usersLength == 5) {
                  this.nameFontSize = 12;
                  this.emailFontSize = 10;
                } else {
                  this.nameFontSize = 10;
                  this.emailFontSize = 10;
                }
                this.doAnimate();
            } catch(err) {
                this.error = err.message;
            }
        },
        doAnimate($event) {
            const elem = this.$refs.buttonAnimated;
            elem.click();
        }
    },
    mounted: function () {
        this.fetchData();
        this.interval = setInterval(function () {
            this.fetchData();
            this.doAnimate();
        }.bind(this), 5000);
    },
}
</script>

